import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const empleado = {
      name: "Lyzmar Padilla",
      job: "Software Developer"
    }
    return (
      <React.Fragment>
        <div className="container">
          <h1>Detalle de Empleados:</h1>        
          <p>Nombre: {empleado.name}</p>
          <p>Cargo: {empleado.job}</p>
        </div>          
      </React.Fragment>
    );
  }
}

export default App;
